import React from 'react'
import { useRef } from 'react'

const App = () => {
 const image1Ref= useRef(null)
 const image2Ref= useRef(null)

 const swapHandler=()=>{
  const src1= image1Ref.current.getAttribute('src')
  const src2= image2Ref.current.getAttribute('src')

  image1Ref.current.setAttribute('src', src2)
  image2Ref.current.setAttribute('src', src1)

 }


  return (
    <div>
      <div className='h-screen w-full bg-black flex justify-evenly items-center '>
            <div className='h-[20vw] w-[30vw] bg-white rounded-2xl overflow-hidden'>
              <img ref={image1Ref} className='h-[100%] w-[100%] object-cover' src="data:image/jpeg;base64," alt="" />
            </div>
            <button onClick={swapHandler} className='px-6 py-2 bg-white rounded-xl font-bold'>SWAP</button>
            <div  className='h-[20vw] w-[30vw] bg-green-500 rounded-2xl overflow-hidden '>
              <img ref={image2Ref} className='h-[100%] w-[100%] object-cover' src="data:image/jpeg;base64," alt="" />
            </div>
      </div>
    </div>
  )
}

export default App
